describe('dc.barChart.biggish', function () {
    beforeEach(function () {
        appendChartID('stack-chart');
        appendChartID('range-chart');
        var chartAttemptSeries = dc.lineChart('#stack-chart');
        var chartRange = dc.barChart('#range-chart');

        var dateFormat = d3.time.format.iso;

        var xfilter;

        var data = biggishData();

        data.forEach(function (row) {
            // coerce k(ind) into a number
            row.k = +row.k;
            // convert event time into d3 date format
            row.dd = dateFormat.parse(row.t);
            // pre-calculate the day of the time
            row.day = d3.time.day(row.dd);
            // precalculate the hour of the time
            row.hour = d3.time.hour(row.dd);
            // coerce n(umber of attempts) into a number
            row.n = +row.n;
        });

        xfilter = crossfilter(data);

        // hour dimension (across all kinds)
        var dimHour = xfilter.dimension(function (row) { return row.hour; });

        // grouping used by the range chart (sum of number of attempts for all kinds per hour)
        var groupHourSum = dimHour.group().reduceSum(function (row) { return row.n; });

        // groupings used by the stacked bar chart (one value for each kind)
        var groupHourSeries = dimHour.group().reduce(
            function (p, v) {
                switch (v.k) {
                    case 1:
                        p.hma += v.n;
                        break;
                    case 2:
                        p.bfa += v.n;
                        break;
                    case 3:
                        p.uha += v.n;
                        break;
                } // switch
                return p;
            },
            function (p, v) {
                switch (v.k) {
                    case 1:
                        p.hma -= v.n;
                        break;
                    case 2:
                        p.bfa -= v.n;
                        break;
                    case 3:
                        p.uha -= v.n;
                        break;
                } // switch
                return p;
            },
            function () {
                return {
                    hma: 0,
                    bfa: 0,
                    uha: 0
                };
            }
        );

        // calculate day extent (two element array of first and last items in the range) - of the hour data
        var extentDay = d3.extent(data, function (row) { return row.day; });
        // select the following day for the end of the extent
        extentDay[1] = d3.time.day.offset(extentDay[1], 1);

        chartAttemptSeries
            .margins({top: 30, right: 50, bottom: 25, left: 40})
            .renderArea(true)
            .height(200)
            .x(d3.time.scale().domain(extentDay))
            .renderHorizontalGridLines(true)
            .rangeChart(chartRange)
            .transitionDuration(1000)
            .brushOn(false)
            .mouseZoomable(true)
            .elasticY(true);

        chartAttemptSeries
            .dimension(dimHour)
            .group(groupHourSeries, 'Brute Force')
            .valueAccessor(function (d) { return d.value.bfa; })
            .stack(groupHourSeries, 'Horizontal Movement', function (d) { return d.value.hma; })
            .stack(groupHourSeries, 'User Account Hacking', function (d) { return d.value.uha; })
            .xUnits(d3.time.hours);

        chartAttemptSeries.legend(dc.legend().horizontal(true).x(50).y(0).itemWidth(150).gap(5));

        chartRange
            .height(80)
            .dimension(dimHour)
            .group(groupHourSum)
            .centerBar(true)
            .gap(1)
            .xUnits(d3.time.hours)
            .round(d3.time.hour.round)
            .alwaysUseRounding(true)
            .x(d3.time.scale().domain(extentDay))

        // hide the range chart's y axis
        // note: breaks function chaining by returning the yAxis
            .yAxis().tickFormat('')
                .tickValues([0])
                .tickSize([0, 0]);

        dc.renderAll();

    });

    describe('smoke test for #909', function () {
        it('doesn\'t die', function () {
            expect(true).toBeTruthy();
        });
    });
});
